import styled from 'styled-components';

export const StyledInput = styled.input`
  border: 1px solid white;
  padding: 10px 15px;
  outline: none;
  box-shadow: none;
  border-radius: 8px;
  width: 29vh;
  height: 4.5vh;
`;
